import React, { Component, Button } from "react";
import API from "../utils/API";
import Container from "@material-ui/core/Container";
import { Grid } from "@material-ui/core";

class Home extends Component {

  render() {
    return (
      <Grid container >

<div style="padding:56.25% 0 0 0;position:relative;"><iframe src="https://player.vimeo.com/video/355394337?color=ffffff" style="position:absolute;top:0;left:0;width:100%;height:100%;" frameborder="0" allow="autoplay; fullscreen" allowfullscreen></iframe></div><script src="https://player.vimeo.com/api/player.js"></script>
<p>Brody W. 27 August 2019 from <a href="https://vimeo.com/user102038409">Dian Mak</a> on <a href="https://vimeo.com">Vimeo</a>.</p>

        <h1>TEST</h1>
      </Grid>
    );
  }
}

export default Home;
